static void
read_literal (const int mark)
{
	size_t		i;
	int		c;

	i = 0;
	while ((c = input ()) != EOF) {
		plexbuff[i++] = (cob_u8_t)c;
		if (c == mark && (c = input ()) != mark) {
			i--;
			if (c == '-') {
				/* Free format continuation */
				/* Hack it as concatenation */
				unput ('&');
			} else {
				unput (c);
			}
			break;
		}
		if (i >= plexsize) {
			plexsize *= 2;
			plexbuff = cobc_realloc (plexbuff, plexsize);
		}
	}
	if (!i) {
		cb_warning (_("Alphanumeric literal has zero length"));
		cb_warning (_("A SPACE will be assumed"));
		i = 1;
		plexbuff[0] = ' ';
	}
	plexbuff[i] = 0;
	yylval = cb_build_alphanumeric_literal (plexbuff, i);
	SET_LOCATION (yylval);
}

static int
scan_x (char *text, const int mark)
{
	unsigned char		*src;
	unsigned char		*dst;
	size_t			currlen;
	int			high;
	int			c;

	currlen = strlen (text);
	if (currlen > plexsize) {
		plexsize = currlen;
		plexbuff = cobc_realloc (plexbuff, plexsize);
	}
	src = (unsigned char *)text;
	dst = plexbuff;
	high = 1;
	for (; (int)*src != mark; src++) {
		c = (int)*src;
		if ('0' <= c && c <= '9') {
			c = c - '0';
		} else if ('A' <= c && c <= 'F') {
			c = c - 'A' + 10;
		} else if ('a' <= c && c <= 'f') {
			c = c - 'a' + 10;
		} else {
			goto error;
		}
		if (high) {
			*dst = (cob_u8_t)(c << 4);
		} else {
			*dst++ += (cob_u8_t)c;
		}
		high = 1 - high;
	}

	if (high) {
		yylval = cb_build_alphanumeric_literal (plexbuff, (size_t)(dst - plexbuff));
		SET_LOCATION (yylval);
		return LITERAL;
	}
	/* Fall through */
error:
	cb_error (_("Invalid X literal: %s"), text);
	yylval = cb_error_node;
	return LITERAL;
}

